import React from 'react'
import { Navbar3 } from '../../components'

const AuthResult = ({action, result}) => {
  return (
    <div>
        <Navbar3/>
        <div className='login'>
          <h1>{action} {result}.</h1>

        </div>
    </div>
  )
}

export default AuthResult
